INSERT INTO `a_scenic_spot` (`id`, `create_by`, `create_time`, `del_flag`, `update_by`, `update_time`, `address`, `content`, `image`, `open_time`, `price`, `title`, `type`, `url`) VALUES
	('1613456814429573120', 'admin', '2023-01-12 16:44:15.000000', 0, 'admin', '2023-05-22 15:50:02.807000', '厦门市思明区鼓浪屿', '日光岩（英文：Sunlight Rock）俗称“岩仔山”，别名“晃岩”，相传1641年，郑成功来到晃岩，看到这里的景色胜过日本的日光山，便把“晃”字拆开，称之为“日光岩”', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1698867080327204864.png', '2023年6月1日-2023年9月30日（夏令时） 08:00-18:00；2023年10月1日-次年2023年5月31日（冬令时） 08:00-17:30,', 50.00, '日光岩', '四星级景点', 'https://you.ctrip.com/sight/xiamen21/2345.html'),
	('1613456814429573121', 'admin', '2023-01-12 16:44:15.000000', 0, 'admin', '2023-05-22 15:40:48.748000', '厦门市思明区鼓浪屿港仔后路7号', '菽庄花园，位于福建省厦门市思明区鼓浪屿岛南部，建于民国二年（1913年），面向大海，背倚日光岩，原是地方名绅林尔嘉的私人别墅，园主人以他的字“叔臧”的谐音命名花园，1955年，园主亲人将此园献给国家', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1698867083393241088.png', '08:00-17:30', 30.00, '菽庄花园', '三星级景点', 'https://you.ctrip.com/sight/xiamen21/2346.html#ctm_ref=www_hp_bs_lst'),
	('1613456814429573122', 'admin', '2023-01-12 16:44:15.000000', 0, 'admin', '2023-05-22 15:56:57.477000', '厦门市思明区鼓浪屿', '位于鼓浪屿东部，座落在鼓浪屿东南，濒临鹭江。是一座郑成功纪念园，覆鼎岩海滨，占地二万平方米', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1698867084538286080.png', '2023年6月1日-2023年9月30日（夏令时） 08:00-18:00,；2023年10月1日-次年2023年5月31日（冬令时） 08:00-17:30,', 10.00, '皓月园', '四星级景点', 'https://www.cncn.com/piao/hainan/'),
	('1613456814429573123', 'admin', '2023-01-12 16:44:15.000000', 0, 'admin', '2023-05-22 15:43:07.197000', '厦门市思明区复兴路', '毓园位于福建省厦门鼓浪屿东南部复兴路，即林巧稚大夫纪念园，为纪念人民医学家林巧稚大夫而建。毓园之"毓"，就是培育养育之意，故得名。毓园建于1984年5月，占地5700平方米', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1698867085490393088.png', '8:00-17:30', 0.00, '毓园', '四星级景点', '无需门票'),
	('1613456814429573124', 'admin', '2023-01-12 16:44:15.000000', 0, 'admin', '2023-05-22 15:52:37.706000', '厦门市思明区鼓浪屿鼓声路', '鼓浪石是鼓浪屿沿海的一座礁石，相传“鼓浪屿”岛名由来于此，鼓浪屿唐宋时称“圆沙洲”、“圆洲仔”，乃是因为小岛呈椭圆形，四周遍布沙滩，形象而称之。那时岛上巨石满坡，绿草丰茂，却渺无人烟，颇为荒凉。', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1698867086249562112.png', '具体开放时间请咨询景区', 0.00, '鼓浪石', '三星级景点', '无需门票'),
	('1613456814429573125', 'admin', '2023-01-12 16:44:15.000000', 0, 'admin', '2023-05-22 15:48:19.973000', '厦门市思明区港仔后路7号菽庄花园内', '鼓浪屿钢琴博物馆，分上下两层，两座馆楼，博物馆里陈列了爱国华侨胡友义收藏的40多架古钢琴，其中有稀世名贵的镏金钢琴，有世界最早的四角钢琴和最早最大的立式钢琴，有古老的手摇钢琴、有产自一百年前的脚踏自动演奏钢琴和八个脚踏的古钢琴等', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1698867087088422912.png', '08:00-17:30', 0.00, '钢琴博物馆', '四星级景点', '无需门票'),
	('1613456814429573126', 'admin', '2023-01-12 16:44:15.000000', 0, 'admin', '2023-05-22 15:44:21.819000', '厦门市思明区永春路73号', '纪念馆建是海内外最大的郑成功文物文献收藏中心和研究基地，犹存寨门、水操台等遗址。 全馆分为七个部分，展出各种文物、资料、照片、雕塑和模型三百余件，比较系统地展示了郑成功的生平事迹', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1698867087784677376.png', '周二-周日8:30-16:45，16:30停止入场，周一闭馆。', 0.00, '郑成功纪念馆', '四星级景点', '无需门票'),
	('1613456814429573130', 'admin', '2023-01-12 16:44:15.000000', 0, 'admin', '2023-05-22 15:51:33.314000', '厦门市思明区鼓浪屿龙头路2号', '海底世界拥有180度亚克力透明玻璃构成的隧道，长74米，宽3米，高2.4米，储水量4000多吨，其中生活着百余种海洋鱼类。', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1698867088631926784.png', '08:00-21:00', 107.00, '海底世界', '五星级景点', 'https://you.ctrip.com/sight/xiamen21/8619.html#ctm_ref=www_hp_bs_lst'),
	('1613456814429573131', 'admin', '2023-01-12 16:44:15.000000', 0, 'admin', '2023-05-22 15:45:55.204000', '厦门市思明区大学路', '从厦门大学的白城校门出来，过了桥就是白城沙滩，这里沙子质量不算特别好，不过却挺热闹，很多人在这里游泳，玩耍，自有一份南方城市的闲适。', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1698867089605005312.png', '全天开放', 0.00, '白城沙滩', '三星级景点', '无需门票'),
	('1613456814429573132', 'admin', '2023-01-12 16:44:15.000000', 0, 'admin', '2023-05-22 15:34:41.081000', '厦门市思明区鼓浪屿福建路38号', '海天堂构位于鼓浪屿福建路38号，始建于1921年，2002年4月被厦门市政府列为重点历史风貌建筑。修复后开放的“海天堂构”老别墅是中西方文化结合的典范之作', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1698867090607443968.png', '08:30-15:30', 78.00, '海天堂构', '四星级景点', 'https://you.ctrip.com/sight/xiamen21/67695.html#ctm_ref=www_hp_bs_lst'),
	('1660159468106813440', 'admin', '2023-05-21 13:43:56.000000', 0, 'admin', '2023-05-22 15:37:37.154000', '厦门市思明区中山路56号', '中山路全长1198米，宽15米，位于厦门市思明区繁华闹市，一头连着厦庇五洲客的宾馆大厦，一头连着门泊万倾涛的碧波大海，与海上花园“鼓浪屿”遥遥相望。中山路的骑楼街是厦门建筑文化的代表，这些建筑绝大部分是二十年代华侨回乡建造的，在我市的城市总体规划中已被列为旧城保护的重点。', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1698867091375001600.png', '全年 全天开放', 0.00, '中山路步行街', '其他景点', '无需门票'),
	('1660556083296604160', 'admin', '2023-05-22 15:59:56.602000', 0, NULL, NULL, '厦门市同安区五显镇北辰山景区', '北辰山人文古迹众多，自然景观也很不错，在这里可以了解五代闽王王审知的事迹，还可以看宏伟的王审知雕像。此外，这里有王公庙，可以烧香拜拜。当然，这里有名的景点还是要数十二龙潭瀑布。', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1698867091903483904.png', '全年 周一-周五 09:30-16:30, 周六-周日 09:00-17:00', 25.00, '北辰山', '五星级景点', 'https://you.ctrip.com/sight/xiamen21/1414346.html#ctm_ref=www_hp_bs_lst'),
	('1660558385797533696', 'admin', '2023-05-22 16:09:05.563000', 0, NULL, NULL, '厦门市同安区石浔南路1111号', '厦门方特梦幻王国是一个以高科技为主的文化科技主题公园。坐落于海滨古城厦门市同安区。它以科幻和互动体验为特色，被誉为“东方梦幻乐园”、“亚洲科幻神奇”。', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1698867092595544064.png', '10:00-18:00', 299.00, '厦门方特梦幻王国', '五星级景点', 'https://you.ctrip.com/sight/xiamen21/140141.html#ctm_ref=www_hp_bs_lst'),
	('1660559616733483008', 'admin', '2023-05-22 16:13:59.037000', 0, NULL, NULL, '厦门市湖里区五缘湾道', '五缘湾湿地公园占地85公顷，面积相当于半个鼓浪屿，是厦门大的公园，也是大的湿地生态园区，被称为是厦门的城市绿肺。每年的3月，大批的白鹭会在此筑巢，繁殖，也是候鸟南北迁徙的重要驿站。', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1698867093061111808.png', '全天开放', 0.00, '五缘湾湿地公园', '四星级景点', '无需门票'),
	('1660560645390733312', 'admin', '2023-05-22 16:18:04.000000', 0, 'admin', '2023-05-22 16:20:41.343000', '厦门市海沧区孚莲路1888号', '日月谷温泉算是厦门较为知名的温泉了，来厦门如果想要放松下，必定要考虑下这里。它充满了浓郁的东南亚风情，环境优美，地方大，并且汤池种类齐全，水还很干净。', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1698867093916749824.png', '10:00-22:00', 188.00, '日月谷温泉', '五星级景点', 'https://you.ctrip.com/sight/xiamen21/48767.html#ctm_ref=www_hp_bs_lst');
