INSERT INTO `a_trip` (`id`, `create_by`, `create_time`, `del_flag`, `update_by`, `update_time`, `content`, `end`, `image_url`, `spot_id`, `spot_name`, `start`, `title`, `way`) VALUES
	('1613708628185976836', 'admin', '2023-01-13 09:24:52.000000', 0, 'admin', '2023-05-21 16:37:30.710000', '酒店位于鹭江道，俯瞰历史悠久的鼓浪屿及周边海景，毗邻百年中山路商业区，便捷到达厦门岛内各主要观光景点，地理位置得天独厚。\n酒店地处厦门市商业中心，与鼓浪屿遥海相望，秀色一览无遗。\n酒店距商业区、观光景点、购物区与娱乐区均十分便利，距厦门国际会议展览中心约30分钟车程；同时位于地铁起点/终点站镇海路站附近，步行约3分钟即可到达。\n酒店畅享46平方米及以上的宽敞客房空间的同时，您可以放松身心，欣赏鼓浪屿上的绝妙景色。', '1???', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1698867080327204864.png', '1613456814429573120', '中山路步行街', '7??', '厦门瑞颐大酒店', '自助早餐'),
	('1613708628185976847', 'admin', '2023-01-13 09:24:52.000000', 0, 'admin', '2023-05-21 16:38:35.736000', '民宿位于海上花园鼓浪屿内厝澳路，紧邻厦门市艺术学校。\n海滨浴场、日光岩、钢琴博物馆等著名游览点近在咫尺，地理位置十分优越。\n民宿是花园别墅式庭院，内部设施齐全，欢迎来鼓浪屿放松心情，感受别样的鼓浪屿情怀，欢迎来鼓浪屿ONE SMALL红堡民宿，尽情享受鼓浪屿的人文景观和品味鼓浪屿悠久的历史建筑。', '1???', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1698867083393241088.png', '1613456814429573121', '中山路步行街', '3??', '鼓浪屿ONE SMALL红堡民宿', '不含早餐'),
	('1660168130753859584', 'admin', '2023-05-21 14:18:21.000000', 0, 'admin', '2023-05-21 16:42:40.147000', '鼓浪屿元气民宿位于鼓浪屿景区内，这座岛屿已被列入世界遗产名录。\n净白的墙面，趣味的“大笑脸”外墙造型，满满的正能量，因此取名【元气】。\n走进元气通高的大堂犹如美术馆一般神圣庄严，大大区别于传统民宿狭窄密闭的氛围，让人不自主的沉下心，感受设计的魅力（设计的每个小细节都等待你惊喜发现哟~~），和爱你的人，和你爱的人，一起享受旅程该有的静谧和安逸，读书写字看报，观影休闲娱乐，过一个美好的假期吧。', '5??', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1698867084538286080.png', '1613456814429573122', '鼓浪屿钢琴博物馆', '2??', '鼓浪屿元气民宿', '不含早餐'),
	('1660169125223337984', 'admin', '2023-05-21 14:22:18.000000', 0, 'admin', '2023-05-21 16:41:39.912000', '厦门栖隐度假民宿位于厦门市思明区曾厝垵西里73号，厦大学生公寓旁，邻近西宅水库、厦门园林植物园、厦门大学高尔夫练习场、白鹭园高尔夫俱乐部等地，距离厦门站约11公里；距离厦门高崎国际机场约19.4公里，地理位置优越，环境优雅。', '9??', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1698867085490393088.png', '1613456814429573123', '海天堂构', '3??', '厦门栖隐度假民宿', '不含早餐'),
	('1660173269015334912', 'admin', '2023-05-21 14:38:46.000000', 0, 'admin', '2023-05-21 16:45:06.344000', '喜林阁旅馆(鼓浪屿世界文化遗产店)位于鼓浪屿岛上，前身为英国伦敦差会（姑娘楼）建于1842年，拥有百年历史文化的英式建筑，富有异国风情。\n旅馆离日光岩西林门约5米之遥，紧临郑成功纪念馆、琴园，离菽庄花园、海边约3分钟路程。\n旅馆提供不同主题的客房和250多平的院子以及一个美丽的英式回廊，同时还有书房等公共配套。\n全旅馆提供无线网络。', '1???', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1698867086249562112.png', '1613456814429573124', '郑成功纪念馆', '4??', '喜林阁旅馆(鼓浪屿世界文化遗产店)', '两份早餐'),
	('1660203848054214656', 'admin', '2023-05-21 16:40:17.222000', 0, NULL, NULL, '六月的海风吹过老厦门南洋风骑楼，从熙攘大道走入僻静街巷，转角就是满眼烟火气的升平路。\n厦门MisooHi·觅海民宿，就藏在这条闹中取静的街道上。\n民宿是由独栋老建筑改造而来，历经数月工程，褪去陈旧外表，由内而外焕发新生，成为了旅客们的新家。\n设计师以包豪斯风格和美学空间为灵感，在保留空间与色彩纯粹性的同时，把握每一处细节的美感，打造出这一处兼具空间意境、生活质感和人文温度的民宿建筑。', '1???', 'https://asoa-1305425069.cos.ap-shanghai.myqcloud.com/1698867087088422912.png', '1613456814429573125', '钢琴博物馆', '7??', '厦门MisooHi觅海民宿(中山路步行街轮渡码头店)', '两份早餐');
